import"./background.css"

export function BackgroundBlock({icons}){
    const onClick = (e) =>{
        console.log("Добавлено")
    }
    return(
    <div className="main-container__background-image">
        {icons.map((elem) => {
            return <button className="background-image__button--calendar"  onClick={onClick}>
                <img src={elem.picture} alt="calendar"/>   
            </button>
        })}
        <img src="../image/background-img.jpg" alt="space image"></img>
    </div>
    );
}
